import {Validator} from "../base";
import {ILoginParams} from "@entities/user";
import {ValidatorData} from "@shared/lib/validator/models";

export type LoginValidatorData = ILoginParams & ValidatorData;

export class LoginValidator extends Validator {
    validate(data: LoginValidatorData): Partial<LoginValidatorData> {
        return Validator.validate({
            username: Validator.required(data.username),
            password: Validator.required(data.password)
        });
    }
}
